import React from "react";

const ExpenseFilter = (props) => {
  const DropdownHander = (event) => {
    props.onChangeFilter(event.target.value);
  };
  return (
    <div>
      <label>Filter of the year</label>
      <select onChange={DropdownHander}>
        <option>'2001</option>
        <option>'2002</option>
        <option>'2003</option>
        <option>'2004</option>
      </select>
    </div>
  );
};
export default ExpenseFilter;
